create table order_products
(
    id                         int unsigned auto_increment comment '订单商品ID'
        primary key,
    marketing_rule             tinyint         default 1                 not null comment '营销规则，0：活动专区、1：平价区、2：复购区',
    order_id                   int unsigned                              not null comment '订单ID',
    delivery_package_id        int unsigned    default 0                 not null comment '配送包裹ID',
    original_product_id        int unsigned                              not null comment '商品库ID，备查',
    product_name               varchar(128)                              null comment '商品名称',
    product_category_name      varchar(32)                               null comment '分类名称',
    product_category_name_abbr varchar(32)                               not null comment '分类名称简称',
    product_cover_image_id     int unsigned                              not null comment '封面图的文件ID',
    product_cover_image_path   varchar(255)                              not null comment '封面图的文件相对路径',
    product_cover_image_url    varchar(255)                              not null comment '封面图的文件URL',
    sku_code                   varchar(255)                              not null comment '单品编码',
    sorted_spec_value_ids      varchar(255)                              not null comment '已排序的规格值ID，逗号分隔',
    price_in_cents             bigint unsigned                           not null comment '价格（分）',
    required_redemption_point  int unsigned    default 0                 not null comment '复购商品所需的复购积分',
    cost_price_in_cents        bigint unsigned default 0                 not null comment '成本价（分）',
    sku_description            text                                      not null comment 'SKU 描述（格式为"规格项01：规格值01；规格项02：规格值02"）',
    count                      int unsigned                              not null comment '单品数量',
    has_triple_points          tinyint(1)      default 0                 not null comment '购买时是否赠送三倍积分',
    created_at                 datetime        default CURRENT_TIMESTAMP not null,
    updated_at                 datetime                                  null,
    deleted_at                 datetime                                  null
)
    collate = utf8mb4_unicode_ci;

create index order_products_delivery_package_id_index
    on order_products (delivery_package_id);

create index order_products_order_id_index
    on order_products (order_id);

